        """
        Removes a song from the playlist.
        :param song: The song to remove from the playlist, str.
        """
        if song in self.playlist:
            self.playlist.remove(song)
        else:
            raise ValueError("Song is not in the playlist")


    def play(self):
        """
        Plays the current song in the playlist.
        :return: The current song in the playlist, or False if there is no current song.
        """
        if self.playlist:
            self.current_song = self.playlist[0]
            return self.current_song
        else:
            return False


    def stop(self):
        """
        Stops the current song in the playlist.
        :return: True if the current song was stopped, False if there was no current song.
        """
        if self.current_song is not None:
            self.current_song = None
            return True
        else:
            return False


    def switch_song(self):
        """
        Switches to the next song in the playlist.
        :return: The next song in the playlist, or False if there is no next song.
        """
        if self.playlist:
            current_index = self.playlist.index(self.current_song)
            if current_index == len(self.playlist) - 1:
                self.current_song = self.playlist[0]
            else:
                self.current_song = self.playlist[current_index + 1]
            return self.current_song
        else:
            return False


    def previous_song(self):
        """
        Switches to the previous song in the playlist.
        :return: The previous song in the playlist, or False if there is no previous song.
        """
        if self.playlist:
            current_index = self.playlist.index(self.current_song)
            if current_index == 0:
                self.current_song = self.playlist[-1]
            else:
                self.current_song = self.playlist[current_index - 1]
            return self.current_song
        else:
            return False


    def set_volume(self, volume):
        """
        Sets the volume of the music player, if the volume is between 0 and 100.
        :param volume: The volume to set the music player to, int.
        :return: True if the volume was set, False if the volume was invalid.
        """
        if 0 <= volume <= 100:
            self.volume = volume
            return True
        else:
            return False


    def shuffle(self):
        """
        Shuffles the playlist.
        :return: True if the playlist was shuffled, False if the playlist was empty.
        """
        if self.playlist:
            random.shuffle(self.playlist)
            self.current_song = self.playlist[0]
            return True
        else:
