        self.NUMBER_SUFFIX = ["k", "w", "", "m", "", "", "b", "", "", "t", "", "", "p", "", "", "e"]



    def format(self, x):
        if not isinstance(x, (int, float)):
            raise ValueError("Input must be a number")

        if x < 0:
            return "MINUS " + self.format(-x)

        if x == 0:
            return "ZERO"

        result = []
        for i, part in enumerate(str(x).split('.')):
            word = self.convert_to_words(int(part))
            if i == 1:
                word += " AND " + self.convert_to_words(int(part[1:]))
            result.append(word)

